public class Factorial {

    public static long calculateFactorial(int n) {
        if (n < 0) {
            throw new IllegalArgumentException("Factorial is not defined for negative numbers.");
        }
        if (n == 0 || n == 1) {
            return 1;
        }
        long result = 1;
        for (int i = 2; i <= n; i++) {
            result *= i;
        }
        return result;
    }

    public static void main(String[] args) {
        int number = 5;
        System.out.println("Factorial of " + number + " is: " + calculateFactorial(number)); // Output: 120

        number = 0;
        System.out.println("Factorial of " + number + " is: " + calculateFactorial(number)); // Output: 1

        number = 10;
        System.out.println("Factorial of " + number + " is: " + calculateFactorial(number)); // Output: 3628800
    }
}
